script: |
  super -f text -I q9465.spq | sort > q9465.out

inputs:
  - name: q9465.spq
    data: |
      SELECT DISTINCT - + col1 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + 88 + 24 IN ( col0, + col0, - col0 + + - 37 * - col0 ) OR NOT NULL IS NOT NULL;
  - name: tab0

outputs:
  - name: q9465.out
    data: |
      -1
      -21
      -81
